/* Context */
import { useAuthContext } from "../../hooks/useAuthContext";

/* Styling */
import "./Home.css"

export default function Home() {

    const { state } = useAuthContext()

    return (
        <div className="home">
            <h1>Welcome { state.username } !</h1>
            <p>Your stats</p>
            <p>Game played</p>
            <p>Win rate</p>
        </div>
    )
}
